import stars from '../assets/symbols/stars.png';

export default function Profile() {
  return (
    <div>

      <div id="profileHead">
      <h2>Pancho Rodriguez</h2>
      <h4>Fullerton, CA</h4>
      <img href="" alt="" src={stars}/>
      <h4>2 Reviews</h4>
      </div>

      <div id="fillerSpace"></div>

    </div>

  )
}
